	add("negator", "{\"term\":\"negator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{suffix|negate|or|lang\u003den}}, or directly from Latin {{m|la|negātor}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, negates\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A word (or other structural element) which causes negation (such as the word in English\", \"priority\":2}]}, \"synonyms\":{}}");

