	add("negawatt", "{\"term\":\"negawatt\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Amory Lovins|Amory Lovins, chairman of the w:Rocky Mountain Institute|Rocky Mountain Institute as a contraction of \u0027\u0027 \u0027\u0027 on the model of similar compounds like \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of saved energy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Barbara Whitaker, \u0026quot;[http://query.nytimes.com/gst/fullpage.html?res\u003d940DE6D81738F937A15751C1A9669C8B63 A Lightning Rod in California]\u0026quot;, \u0027New York Times\u0027, 24 December\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And he has suggested ways to help consumers buy the so-called time-of-use-meters so they can benefit from using energy at off-peak times and through \u0026quot;\u0027\u0027negawatts,\u0027\u0027\u0026quot; or credits for not using power\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Amory B. Lovins, \u0026quot;[http://www.forbes.com/energy/2008/07/03/energy-efficiency-biz-energy_cx_al_0707efficiency_lovins.html The Case For Efficiency]\u0026quot;, \u0027Forbes\u0027, 7 July\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Three-fourths of U.S. electricity--69% of which is used in buildings, nearly all the rest in industry--can be saved for less than the price of just running a coal or nuclear plant. This \u0026quot;\u0027\u0027negawatt\u0027\u0027\u0026quot; potential is not just in smarter motors, lights, appliances, etc., but even more in their larger systems\", \"priority\":5}]}, \"synonyms\":{}}");

	add("negentropy", "{\"term\":\"negentropy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Volume-specific entropy surplus above background, which can be exported and do work in the process\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The bound entropy is determined by the microscopic degrees of freedom of the network and is not available as useable information. In analogy with free energy, which is the energy available to do work, we have free entropy, which is the entropy available to produce useful information. Thus, the free entropy is precisely the neg-entropy discussed by Szilárd, Wiener, Brillouin and so many others.\u0026lt;ref\u0026gt;West, Bruce J.; Scafetta, Nicola ♦ Disrupted Networks: From Physics to Climate Change ♦ Studies of Nonlinear Phenomena in Life Science, v. 13. World Scientific, 2010, p. 150\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"negentropy is really another term for an increase in available energy.\u0026lt;ref\u0026gt;Corning, Peter A. ♦ Holistic Darwinism: Synergy, Cybernetics, and the Bioeconomics of Evolution ♦ University of Chicago Press, 2005, p.\u0026amp;nbsp;329\u0026lt;/ref\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"To be useful, internal energy has to be concentrated. The more dilute or disorganized the internal energy, the less useful it is ...\u0026lt;ref\u0026gt;Newman, Jay ♦ Physics of the Life Sciences ♦ Springer, 2008, p. 336\u0026lt;/ref\u0026gt\", \"priority\":4}]}, \"synonyms\":{}}");

	add("négligée", "{\"term\":\"négligée\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027négligé\u0027 (underdressed; loose garment) past participle of \u0027négliger\u0027 () from Latin \u0027negligere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A light women\u0027s gown\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A loose women\u0027s dressing-gown, especially when lacy or revealing; a nightgown\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027The Guardian\u0027, 4 July 2000\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Enkhbayar has promised more jobs, free education and higher public service wages to the poverty-ravaged country. But who needs those when you\u0027ve got dancing girls in black \u0027\u0027negligees\", \"priority\":4}]}, \"synonyms\":{}}");

	add("negotiation", "{\"term\":\"negotiation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027négociation\u0027 from Latin \u0027negotiatio\u0027 (the carrying on of business, a wholesale business) from \u0027negotiari\u0027 () see negotiate.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of achieving agreement through discussion\", \"priority\":1}]}, \"synonyms\":{}}");

