	add("negro", "{\"term\":\"negro\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027negro\u0027 (black)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with black or dark brown skin and of African descent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963,\u0027\u0027 w:Martin Luther King, Martin Luther King, \u0027w:Letter from a Birmingham Letter from a Birmingham Jail\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Oppressed people cannot remain oppressed forever. The yearning for freedom eventually manifests itself, and that is what has happened to the American \u0027\u0027Negro\u0027\u0027. Something within has reminded him of his birthright of freedom, and something without has reminded him that it can be gained\", \"priority\":3}]}, \"synonyms\":{}}");

	add("negress", "{\"term\":\"negress\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French {{m|fr|négresse}}, from {{m|fr|nègre}}. Equivalent to {{suffix|Negro|ess|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A black female\", \"priority\":1}]}, \"synonyms\":{}}");

	add("negritude", "{\"term\":\"negritude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027négritude\u0027 (coined by {{w|Aimé Césaire}}), from \u0027nègre|lang\u003dfr\u0027 () + \u0027-tude\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of being of black African descent, especially a conscious pride in the values, cultural identity etc. of African heritage; blackness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Richard A. Long, \u0027Perspective: Negritude\u0027 in \u0027Black World/Negro Digest\u0027, May 1969, Johnson Publishing, page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Negritude\u0027\u0027 is not wearing turbans and fezzes, though these may be quite alluring\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Dorothy S. Blair, \u0027African literature in French: a history of creative writing in French from west and equatorial Africa\u0027, ISBN 9780521211956, CUP Archive, page 144\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Long before \u0027\u0027Negritude\u0027\u0027 had become a war-cry among the Black intellectuals of the Left Bank, Caribbean writers had been composing verses in French that were purely derivative, evoking the Parnassian and neo-Romantic influences of the end of the last century\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Gaurav Gajanan Desai, Supriya Nair, \u0027Postcolonialisms: an anthology of cultural theory and criticism\u0027, ISBN 9780813535524, Rutgers University Press, page 185\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In order to explain this \u0027morality in action\u0027 of \u0027\u0027negritude\u0027\u0027, I must go back a little\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0027Hitch-22\u0027, Atlantic 2011, p. 91\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Another important thing about “CLR,” as he was known in our little movement, was his disdainful opposition to any Third World fetishism or half-baked \u0027\u0027\u0027negritude\", \"priority\":9}]}, \"synonyms\":{}}");

