	add("negus", "{\"term\":\"negus\", \"etymology\":{\"influencers\":[], \"languages\":[\"Amharic\", \"English\"], \"text\":\"From Amharic \u0027ንጉሥ\u0027 (king)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ruler of Ethiopia or of a province of Ethiopia; specifically, the supreme ruler of Ethiopia before 1974\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 240\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was a Syrian merchant, Frumentius, who is credited with converting Ezana, the \u0027\u0027Negus\u0027\u0027 (king or emperor) of the powerful northern Ethiopian state of Aksum\", \"priority\":3}]}, \"synonyms\":{}}");

	add("negus", "{\"term\":\"negus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named from Colonel Francis Negus (died 1732), its creator.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A drink of wine, lemon, sugar, nutmeg and hot water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1857\u0027\u0027, \u0027\u0027, Volume the Second, page 177 (ISBN 1857150570\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And when he got home he had a glass of hot \u0027\u0027negus\u0027\u0027 in his wife\u0027s sitting-room, and read the last number of the “Little Dorrit” of the day with great inward satisfaction\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027\u0027, Chapter VII, Section v\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Esther began […] to cry. But when the fire had been lit specially to warm her chilled limbs and Adela had plied her with hot \u0027\u0027negus\u0027\u0027 she began to feel rather a heroine\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Water Music\u0027, Penguin 2006, p. 258\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"‘I could sure use a cup of \u0027\u0027negus\u0027\u0027 and maybe some hot soup,’ he sniffs\", \"priority\":7}]}, \"synonyms\":{}}");

